import React from "react";
import './Popup.css';

function Popup() {
    return(
        <>
        <div className="popup">
<h2>Success Message</h2>
<h3>**Thank You for registering! Please check your email for verification.**</h3>
<button typy='button' className="btn">OK</button>

        </div>
        </>
    )
};

export default Popup;
